  container: {
    flex: 1,
    justifyContent: "space-between"
  },
  container2: {
    flex: 1,
    justifyContent: "center"
  },
  mapView: {
    flex: 1,
    justifyContent: "center"
  },
  chevron: {
    color: "#e90000"
  },
  rowDirection: {
    flexDirection: "row",
    justifyContent: "space-between"
  },
  loaderContainer: {
    flex: 1,
    justifyContent: "center"
  },
  placeTitleFont: {
    fontSize: 16
